import React, { useState, useEffect } from 'react';
import {
  Box,
  Card,
  CardContent,
  Typography,
  Grid,
  List,
  ListItem,
  ListItemText,
  ListItemAvatar,
  Avatar,
  Chip,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  CircularProgress,
  Alert,
  Paper,
  Divider
} from '@mui/material';
import {
  Person as PersonIcon,
  Schedule as ScheduleIcon,
  LocalHospital as HospitalIcon,
  Add as AddIcon,
  Edit as EditIcon
} from '@mui/icons-material';
import { useForm, Controller } from 'react-hook-form';
import { useAuth } from '../../contexts/AuthContext';
import { apiService } from '../../services/api';
import { ConsultaResponse, StatusConsulta, TipoConsulta, ConsultaUpdate } from '../../types';

const AgendaPage: React.FC = () => {
  const { user } = useAuth();
  const [consultas, setConsultas] = useState<ConsultaResponse[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);
  const [selectedConsulta, setSelectedConsulta] = useState<ConsultaResponse | null>(null);
  const [openDialog, setOpenDialog] = useState(false);

  const { control, handleSubmit, reset, formState: { errors } } = useForm<ConsultaUpdate>();

  const loadConsultasHoje = async () => {
    try {
      setLoading(true);
      const response = await apiService.getConsultasMedicoHoje();
      setConsultas(response);
    } catch (err: any) {
      setError(err.response?.data?.detail || 'Erro ao carregar consultas');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    loadConsultasHoje();
    // Recarregar a cada 5 minutos
    const interval = setInterval(loadConsultasHoje, 5 * 60 * 1000);
    return () => clearInterval(interval);
  }, []);

  const handleOpenDialog = (consulta: ConsultaResponse) => {
    setSelectedConsulta(consulta);
    reset({
      status: consulta.status,
      observacoes: consulta.observacoes || '',
      diagnostico: consulta.diagnostico || '',
      prescricao: consulta.prescricao || ''
    });
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
    setSelectedConsulta(null);
    reset();
  };

  const onSubmit = async (data: ConsultaUpdate) => {
    if (!selectedConsulta) return;

    try {
      await apiService.updateConsulta(selectedConsulta.id, data);
      handleCloseDialog();
      loadConsultasHoje();
    } catch (err: any) {
      setError(err.response?.data?.detail || 'Erro ao atualizar consulta');
    }
  };

  const getStatusColor = (status: StatusConsulta) => {
    const colors: { [key in StatusConsulta]: 'default' | 'primary' | 'secondary' | 'success' | 'warning' | 'error' } = {
      [StatusConsulta.AGENDADA]: 'primary',
      [StatusConsulta.CONFIRMADA]: 'secondary', 
      [StatusConsulta.EM_ANDAMENTO]: 'warning',
      [StatusConsulta.FINALIZADA]: 'success',
      [StatusConsulta.CANCELADA]: 'error'
    };
    return colors[status] || 'default';
  };

  const getTipoIcon = (tipo: TipoConsulta) => {
    switch (tipo) {
      case TipoConsulta.EMERGENCIA:
        return <HospitalIcon color="error" />;
      case TipoConsulta.RETORNO:
        return <ScheduleIcon color="warning" />;
      default:
        return <PersonIcon color="primary" />;
    }
  };

  const formatHorario = (dataHora: string) => {
    return new Date(dataHora).toLocaleTimeString('pt-BR', {
      hour: '2-digit',
      minute: '2-digit'
    });
  };

  const proximaConsulta = consultas
    .filter(c => c.status === StatusConsulta.AGENDADA || c.status === StatusConsulta.CONFIRMADA)
    .sort((a, b) => new Date(a.data_hora).getTime() - new Date(b.data_hora).getTime())[0];

  if (loading) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="400px">
        <CircularProgress />
      </Box>
    );
  }

  return (
    <Box>
      <Typography variant="h4" gutterBottom>
        Minha Agenda - {new Date().toLocaleDateString('pt-BR')}
      </Typography>

      {error && (
        <Alert severity="error" sx={{ mb: 2 }} onClose={() => setError(null)}>
          {error}
        </Alert>
      )}

      <Grid container spacing={3}>
        {/* Resumo do dia */}
        <Grid item xs={12} md={4}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Resumo do Dia
              </Typography>
              <Box mb={2}>
                <Typography variant="body2" color="textSecondary">
                  Total de Consultas
                </Typography>
                <Typography variant="h4" color="primary">
                  {consultas.length}
                </Typography>
              </Box>
              <Box mb={2}>
                <Typography variant="body2" color="textSecondary">
                  Finalizadas
                </Typography>
                <Typography variant="h6" color="success.main">
                  {consultas.filter(c => c.status === StatusConsulta.FINALIZADA).length}
                </Typography>
              </Box>
              <Box mb={2}>
                <Typography variant="body2" color="textSecondary">
                  Pendentes
                </Typography>
                <Typography variant="h6" color="warning.main">
                  {consultas.filter(c => 
                    c.status === StatusConsulta.AGENDADA || 
                    c.status === StatusConsulta.CONFIRMADA ||
                    c.status === StatusConsulta.EM_ANDAMENTO
                  ).length}
                </Typography>
              </Box>
            </CardContent>
          </Card>
        </Grid>

        {/* Próxima consulta */}
        <Grid item xs={12} md={8}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Próxima Consulta
              </Typography>
              {proximaConsulta ? (
                <Paper sx={{ p: 2, backgroundColor: 'primary.light', color: 'primary.contrastText' }}>
                  <Grid container alignItems="center" spacing={2}>
                    <Grid item>
                      <Avatar sx={{ bgcolor: 'primary.main' }}>
                        {getTipoIcon(proximaConsulta.tipo)}
                      </Avatar>
                    </Grid>
                    <Grid item xs>
                      <Typography variant="h6">
                        {proximaConsulta.paciente_nome}
                      </Typography>
                      <Typography variant="body2">
                        {formatHorario(proximaConsulta.data_hora)} - {proximaConsulta.tipo}
                      </Typography>
                      {proximaConsulta.motivo && (
                        <Typography variant="body2">
                          Motivo: {proximaConsulta.motivo}
                        </Typography>
                      )}
                    </Grid>
                    <Grid item>
                      <Button
                        variant="contained"
                        color="secondary"
                        onClick={() => handleOpenDialog(proximaConsulta)}
                      >
                        Iniciar Atendimento
                      </Button>
                    </Grid>
                  </Grid>
                </Paper>
              ) : (
                <Typography color="textSecondary">
                  Nenhuma consulta pendente para hoje
                </Typography>
              )}
            </CardContent>
          </Card>
        </Grid>

        {/* Lista de consultas */}
        <Grid item xs={12}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Todas as Consultas de Hoje
              </Typography>
              {consultas.length === 0 ? (
                <Typography color="textSecondary">
                  Nenhuma consulta agendada para hoje
                </Typography>
              ) : (
                <List>
                  {consultas.map((consulta, index) => (
                    <React.Fragment key={consulta.id}>
                      <ListItem 
                        alignItems="flex-start"
                        sx={{ 
                          cursor: 'pointer',
                          '&:hover': { backgroundColor: 'action.hover' }
                        }}
                        onClick={() => handleOpenDialog(consulta)}
                      >
                        <ListItemAvatar>
                          <Avatar>
                            {getTipoIcon(consulta.tipo)}
                          </Avatar>
                        </ListItemAvatar>
                        <ListItemText
                          primary={
                            <Box display="flex" alignItems="center" gap={1}>
                              <Typography variant="subtitle1">
                                {formatHorario(consulta.data_hora)} - {consulta.paciente_nome}
                              </Typography>
                              <Chip 
                                label={consulta.status} 
                                color={getStatusColor(consulta.status)}
                                size="small"
                              />
                            </Box>
                          }
                          secondary={
                            <Box>
                              <Typography variant="body2" color="textSecondary">
                                Tipo: {consulta.tipo}
                              </Typography>
                              {consulta.motivo && (
                                <Typography variant="body2" color="textSecondary">
                                  Motivo: {consulta.motivo}
                                </Typography>
                              )}
                              {consulta.diagnostico && (
                                <Typography variant="body2" color="textSecondary">
                                  Diagnóstico: {consulta.diagnostico}
                                </Typography>
                              )}
                            </Box>
                          }
                        />
                        <Button
                          variant="outlined"
                          size="small"
                          startIcon={<EditIcon />}
                          onClick={(e) => {
                            e.stopPropagation();
                            handleOpenDialog(consulta);
                          }}
                        >
                          Editar
                        </Button>
                      </ListItem>
                      {index < consultas.length - 1 && <Divider />}
                    </React.Fragment>
                  ))}
                </List>
              )}
            </CardContent>
          </Card>
        </Grid>
      </Grid>

      {/* Dialog para editar consulta */}
      <Dialog open={openDialog} onClose={handleCloseDialog} maxWidth="md" fullWidth>
        {selectedConsulta && (
          <form onSubmit={handleSubmit(onSubmit)}>
            <DialogTitle>
              Consulta - {selectedConsulta.paciente_nome}
            </DialogTitle>
            <DialogContent>
              <Grid container spacing={2} sx={{ mt: 1 }}>
                <Grid item xs={12} md={6}>
                  <Typography variant="body2" color="textSecondary">
                    Horário: {formatHorario(selectedConsulta.data_hora)}
                  </Typography>
                  <Typography variant="body2" color="textSecondary">
                    Tipo: {selectedConsulta.tipo}
                  </Typography>
                  {selectedConsulta.motivo && (
                    <Typography variant="body2" color="textSecondary">
                      Motivo: {selectedConsulta.motivo}
                    </Typography>
                  )}
                </Grid>
                <Grid item xs={12} md={6}>
                  <Controller
                    name="status"
                    control={control}
                    rules={{ required: 'Status é obrigatório' }}
                    render={({ field }) => (
                      <FormControl fullWidth>
                        <InputLabel>Status</InputLabel>
                        <Select {...field} label="Status">
                          <MenuItem value={StatusConsulta.AGENDADA}>Agendada</MenuItem>
                          <MenuItem value={StatusConsulta.CONFIRMADA}>Confirmada</MenuItem>
                          <MenuItem value={StatusConsulta.EM_ANDAMENTO}>Em Andamento</MenuItem>
                          <MenuItem value={StatusConsulta.FINALIZADA}>Finalizada</MenuItem>
                          <MenuItem value={StatusConsulta.CANCELADA}>Cancelada</MenuItem>
                        </Select>
                      </FormControl>
                    )}
                  />
                </Grid>
                <Grid item xs={12}>
                  <Controller
                    name="observacoes"
                    control={control}
                    render={({ field }) => (
                      <TextField
                        {...field}
                        fullWidth
                        label="Observações"
                        multiline
                        rows={3}
                      />
                    )}
                  />
                </Grid>
                <Grid item xs={12}>
                  <Controller
                    name="diagnostico"
                    control={control}
                    render={({ field }) => (
                      <TextField
                        {...field}
                        fullWidth
                        label="Diagnóstico"
                        multiline
                        rows={3}
                      />
                    )}
                  />
                </Grid>
                <Grid item xs={12}>
                  <Controller
                    name="prescricao"
                    control={control}
                    render={({ field }) => (
                      <TextField
                        {...field}
                        fullWidth
                        label="Prescrição"
                        multiline
                        rows={3}
                      />
                    )}
                  />
                </Grid>
              </Grid>
            </DialogContent>
            <DialogActions>
              <Button onClick={handleCloseDialog}>Cancelar</Button>
              <Button type="submit" variant="contained">
                Salvar
              </Button>
            </DialogActions>
          </form>
        )}
      </Dialog>
    </Box>
  );
};

export default AgendaPage;
